  [],\n\t\"revision_timestamp\": \"2015-05-06T21:17:53.363183\",\n\t\"name\": \"high-temperature-shape-memory-alloy-technology-for-inlet-flow-control-project-3d7aa\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Recent advances in propulsion, aerodynamic,
  and noise technologies have led to a revived interest in supersonic cruise aircraft;
  however, achieving economic viability for these vehicles requires dramatic improvements
  in cruise efficiency.  Optimization of inlet performance offers a potent method
  for achieving this goal, and a range of conceptual flow control systems are available
  to address critical problems like blockage, boundary layer bleed, duct length, and
  flow distortion.  By exploiting High Temperature Smart Memory Alloy (HTSMA) technologies,
  these concepts can be mechanized into robust, compact and lightweight devices, enabling
  actuators suitable integration into the inlets of supersonic aircraft.   The proposed
  effort leverages prior successful development of solid state smart structures by
  the investigators in developing of small scale surface-mounted flow control devices
  as well as large scale actuation systems for inlet ramp mechanisms actuated via
  HTSMA technology.  The proposed Phase II will build upon the Phase I proof of concept
  study to further develop a fully integrated active supersonic inlet system, including
  active inlet ramp and deployable flow control devices, as well as the aero/thermo/structural
  analysis models required to design such systems and subcomponents.  In addition,
  Phase II will be the continued refinement and characterization of actuator-ready
  HTSMAs.  \",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
